import React from 'react';
import { Routes, Route } from 'react-router-dom'; 
import './App.css';

// Paginas principales tienda
import HomePage from './pages/HomePage';

// Paginas carrito
import CarritoPage from './pages/Carrito/CarritoPage';
import ComporaPage from './pages/Carrito/CompraPage';
import PagoCorrectoPage from './pages/Carrito/PagoCorrectoPage';
import PagoErrorPage from './pages/Carrito/PagoErrorPage';

// Autenticación
import LoginPage from './pages/LoginPage';
import ProtectedRoute from './components/auth/ProtectedRoute';

// Admin Layout
import AdminHomePage from './pages/AdminHomePage';

// Usuarios
import MainUsuario from './pages/Usuarios/MainUsuario';
import ListarUsuarios from './pages/Usuarios/ListarUsuarios';
import AgregarUsuario from './pages/Usuarios/AgregarUsuario';
import EditarUsuario from './pages/Usuarios/EditarUsuario';

// Inventario
import MainInventario from './pages/Inventario/MainInventario';
import ListadoProductos from './pages/Inventario/ListadoProductos';
import NuevoProducto from './pages/Inventario/NuevoProducto';
import EditarProducto from './pages/Inventario/EditarProducto';
import ProductoReporte from './pages/Inventario/ProductoReporte';
import ProductosCriticos from './pages/Inventario/ProductosCriticos';

// CRUD Mascotas
import ListadoMascotas from './pages/Clientes/Mascotas/ListadoMascotas';
import NuevaMascota from './pages/Clientes/Mascotas/NuevaMascota';
import EditarMascota from './pages/Clientes/Mascotas/EditarMascota';


function App() {
  return (
    <>
      <Routes>

        {/* ========================== */}
        {/* RUTAS PÚBLICAS */}
        {/* ========================== */}
        <Route path="/login" element={<LoginPage />} />
        <Route path="/carrito" element={<CarritoPage />} />
        <Route path="/compra" element={<ComporaPage />} />
        <Route path="/pago-correcto" element={<PagoCorrectoPage />} />
        <Route path="/pago-error" element={<PagoErrorPage />} />
        <Route path="/" element={<HomePage />} />


        {/* ========================== */}
        {/* RUTAS PROTEGIDAS (ADMIN) */}
        {/* ========================== */}
        <Route element={<ProtectedRoute />}>

          {/* ADMIN LAYOUT (usa <Outlet /> adentro) */}
          <Route path="/admin" element={<AdminHomePage />}>

            {/* DASHBOARD PRINCIPAL */}
            <Route index element={<div>Dashboard Principal</div>} />

            {/* USUARIOS */}
            <Route path="usuarios" element={<MainUsuario />} />
            <Route path="usuarios/listarusuarios" element={<ListarUsuarios />} />
            <Route path="usuarios/agregarusuario" element={<AgregarUsuario />} />
            <Route path="usuarios/editarusuario/:id" element={<EditarUsuario />} />

            {/* INVENTARIO */}
            <Route path="inventario" element={<MainInventario />} />
            <Route path="inventario/listadoproductos" element={<ListadoProductos />} />
            <Route path="inventario/nuevoproducto" element={<NuevoProducto />} />
            <Route path="inventario/editarproducto/:id" element={<EditarProducto />} />
            <Route path="inventario/productoreporte" element={<ProductoReporte />} />
            <Route path="inventario/productoscriticos" element={<ProductosCriticos />} />

            {/* CRUD MASCOTAS */}
            <Route path="clientes/mascotas" element={<ListadoMascotas />} />
            <Route path="clientes/mascotas/nueva" element={<NuevaMascota />} />
            <Route path="clientes/mascotas/editar/:id" element={<EditarMascota />} />

          </Route>
        </Route>

        {/* ========================== */}
        {/* RUTA 404 */}
        {/* ========================== */}
        <Route path="*" element={
          <div className="text-center mt-5">
            <h2>404</h2>
            <p>Página no encontrada</p>
            <a href="/">Volver al inicio</a>
          </div>
        } />

      </Routes>
    </>
  );
}

export default App;
